import satori, { type SatoriOptions } from 'satori'


type Props = {
  title: string;
}

export const createSVG = async (props: Props, satoriOptions: SatoriOptions) => {
  const svg = await satori(<OgImage { ...props } />, satoriOptions)
  return svg
}

